import { Link} from 'react-router-dom';
import { IUser } from '../../interfaces/IUser';
import './Card.css'

export interface ICardProps {
}

export default class Card extends React.Component<ICardProps> {

  public render() {

    return (
      <Link to={'/'}>
        <div className="card col p-0">
          <div className="card-body">
            <div className='row'>
              <div className='col-8'>
                <div className="statusNumber text-start">4</div>
                <div className="statusDesc text-muted text-start">Body</div>
              </div>   
              <span className="col material-symbols-outlined">
                group
              </span>
            </div>
          </div>
          <div className="card-footer bg-primary text-white">
            Ver todos
          </div>
        </div>
      </Link>
    );
  }
}
